import React from "react";
import { AppBar } from "@mui/material";

const Header = () =>{
    return (
        <AppBar
            position="fixed"
            style={{
                backgroundColor:'#98c5e9',
                boxShadow:'none',
                padding:'10px 0px',
                borderBottom:'2px solid #00285e'
            }}
        >
        </AppBar>
    )
}

export default Header;
